import React, { useState } from 'react';
import { View, Text, StyleSheet, TouchableOpacity, Modal, TextInput, Button } from 'react-native';
import Icon from 'react-native-vector-icons/FontAwesome';
import { useNavigation } from '@react-navigation/native';

export default function Seller() {
  const navigation = useNavigation();
  const [isModalVisible, setModalVisible] = useState(false);
  const [fastFoodName, setFastFoodName] = useState('');
  const [fastFoodMenu, setFastFoodMenu] = useState('');
  const [fastFoodPrice, setFastFoodPrice] = useState('');

  const toggleModal = () => {
    setModalVisible(!isModalVisible);
  };

  const handleSearch = () => {
    console.log('Fast Food Name:', fastFoodName);
    console.log('Fast Food Menu:', fastFoodMenu);
    console.log('Fast Food Price:', fastFoodPrice);
  };

  return (
    <View style={styles.container}>
      <TouchableOpacity
        onPress={() => navigation.goBack()}
        style={styles.backButton}
      >
        <Icon name="arrow-left" size={24} color="black" />
      </TouchableOpacity>

      <Text style={styles.sectionTitle}>Seller</Text>

      <TouchableOpacity onPress={toggleModal} style={styles.button}>
        <Text style={styles.buttonText}>post a Food</Text>
      </TouchableOpacity>

      <Modal
        animationType="slide"
        transparent={true}
        visible={isModalVisible}
      >
        <View style={styles.modalContainer}>
          <Text style={styles.modalTitle}>Search Fast Food</Text>
          <TextInput
            placeholder="Fast Food Name"
            onChangeText={(text) => setFastFoodName(text)}
            value={fastFoodName}
            style={styles.input}
          />
          <TextInput
            placeholder="Fast Food Menu"
            onChangeText={(text) => setFastFoodMenu(text)}
            value={fastFoodMenu}
            style={styles.input}
          />
          <TextInput
            placeholder="Fast Food Price"
            onChangeText={(text) => setFastFoodPrice(text)}
            value={fastFoodPrice}
            style={styles.input}
          />
          <Button title="Search" onPress={handleSearch} />
          <Button title="Close" onPress={toggleModal} />
        </View>
      </Modal>
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    marginTop: 19,
    paddingHorizontal: 20,
    justifyContent: 'center',
  },
  sectionTitle: {
    fontSize: 24,
    fontWeight: 'bold',
  },
  backButton: {
    position: 'absolute',
    left: 20,
    top: 20,
  },
  button: {
    marginTop: 20,
    backgroundColor: 'blue',
    padding: 10,
    borderRadius: 5,
  },
  buttonText: {
    color: 'white',
    textAlign: 'center',
  },
  modalContainer: {
    flex: 1,
    justifyContent: 'center',
    paddingHorizontal: 20,
  },
  modalTitle: {
    fontSize: 24,
    fontWeight: 'bold',
    marginBottom: 10,
  },
  input: {
    height: 40,
    borderColor: 'gray',
    borderWidth: 1,
    marginBottom: 10,
    paddingHorizontal: 10,
  },
});
